import React from "react";
import { Row, Col, Container } from "reactstrap";

export default class extends React.Component {
  render() {
    const { selectDetail } = this.props;

    return (
      <Container style={{ backgroundColor: "#f6f6f6", paddingTop: 25, paddingBottom: 25 }}>
        <Col style={{ marginLeft: 5, marginRight: 5 }}>
          <Row style={{ marginBottom: 5 }}>
            <Col size={3}>Origin</Col>
            <Col size={5}>{selectDetail===null ? '-' : !selectDetail.origin ? '-' : selectDetail.origin}</Col>
          </Row>
          <Row style={{ marginBottom: 5 }}>
            <Col size={3}>Destination</Col>
            <Col size={5}>{selectDetail===null ? '-' : !selectDetail.destination ? '-' : selectDetail.destination}</Col>
          </Row>
          <Row style={{ marginBottom: 5 }}>
            <Col size={3}>Adult</Col>
            <Col size={5}>{selectDetail===null ? '0' : selectDetail.total_adult}</Col>
          </Row>
          <Row style={{ marginBottom: 5 }}>
            <Col size={3}>Child</Col>
            <Col size={5}>{selectDetail===null ? '0' : selectDetail.total_child}</Col>
          </Row>
          <Row style={{ marginBottom: 5 }}>
            <Col size={3}>Infant</Col>
            <Col size={5}>{selectDetail===null ? '0' : selectDetail.total_infant}</Col>
          </Row>
        </Col>
      </Container>
    );
  }
}
